<!-- HTML header for doxygen 1.9.1-->
<!DOCTYPE html>
<html xmlns="http://www.w3.org/1999/xhtml">
<head>
<meta http-equiv="Content-Type" content="text/xhtml;charset=UTF-8"/>
<meta http-equiv="X-UA-Compatible" content="IE=9"/>
<meta name="generator" content="Doxygen $doxygenversion"/>
<meta name="viewport" content="width=device-width, initial-scale=1"/>
<!--BEGIN PROJECT_NAME--><title>$projectname: $title</title><!--END PROJECT_NAME-->
<!--BEGIN !PROJECT_NAME--><title>$title</title><!--END !PROJECT_NAME-->
<link href="$relpath^tabs.css" rel="stylesheet" type="text/css"/>
<script type="text/javascript" src="$relpath^jquery.js"></script>
<script type="text/javascript" src="$relpath^dynsections.js"></script>
$treeview
$search
$mathjax
<link href="$relpath^$stylesheet" rel="stylesheet" type="text/css" />
$extrastylesheet

<!-- Pagefind -->
<link href="$relpath^pagefind/pagefind-ui.css" rel="stylesheet">
<script src="$relpath^pagefind/pagefind-ui.js"></script>
<script>
window.addEventListener('DOMContentLoaded', (event) => {
    new PagefindUI({ 
        element: "#pagefindsearch", 
        showSubResults: true,
        translations: { placeholder: "Search Full Text" }
    });
});
</script>
</head>
<body>
<div id="top"><!-- do not remove this div, it is closed by doxygen! -->

<!--Title Area-->
<div id="titlearea">
<table cellspacing="0" cellpadding="0" style="width: 100%;">
 <tbody>
 <tr style="height: 56px;">
  <!--Project Logo-->
  <!--Project Name-->
  <td id="projectalign" style="padding-left: 0.5em; width: 100%;">
   <div id="projectname">$projectname&#160;<span id="projectnumber">$projectnumber</span></div>
   <div id="projectbrief">$projectbrief</div>
  </td>
  <!--Search Box-->
   <!--Search Box-->
   <td style="padding-left: 0.5em; text-align: right; padding-right: 20px; white-space: nowrap;">
        <div id="pagefindsearch" class="pagefind-box" style="display: inline-block;"></div>
   </td>
 </tr>
 </tbody>
</table>
</div>
<!--End Title Area-->
<!-- end header part -->
